import React from "react";

const TodoList = (props) => {
    const { taskList =[] } = props
    const updateList = () => {
        taskList.forEach(task=> {
            return (
                <li>{task}</li>
            )
        })
    }
    return (
        <div className="todo-container">
            <ul className="todo-list">
                {updateList}
            </ul>
        </div>
    )
}

export default TodoList
